value:
Vous pouvez définir ici le format de l'adresse selon l'usage en vigueur dans ce pays.

Vous pouvez utiliser les formats de chaînes de caractères python pour afficher tous les champs d'adresse.
Par exemple :
* %(street)s' pour afficher la rue ;

* %(state_name)s' pour afficher le nom de l'état ;

* %(state_code)s' pour afficher le code de l'état ;

* %(country_name)s' pour afficher le nom du pays ;

* %(country_code)s' pour afficher le code du pays ;
